INSERT into jaccard_intersect_size  select vsac1, vsac2, count(distinct RXCUI) from jaccard_intersect  group by vsac1, vsac2 order by vsac1, vsac2;
INSERT into jaccard_difference_size  select vsac1, vsac2, count(distinct RXCUI) from jaccard_difference  group by vsac1, vsac2 order by vsac1, vsac2;